import CharListItem from '../char-list-item';

import './char-list.css';

class CharList extends Component {
    render () {
        return (
            <div className="char-list">
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
                <CharListItem/>
            </div>
        )
    }
}

export default CharList;
